package nl.yc2202.Wasteless.config;
import java.time.LocalDate;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.context.ApplicationListener;
import org.springframework.context.event.ContextRefreshedEvent;
import org.springframework.stereotype.Component;

import nl.yc2202.Wasteless.domein.Item;
import nl.yc2202.Wasteless.domein.User;
import nl.yc2202.Wasteless.persistence.ItemService;
import nl.yc2202.Wasteless.persistence.UserService;

@Component
public class StartupApplicationListener implements 
  ApplicationListener<ContextRefreshedEvent> {
	
	@Autowired
	ItemService is;
	
	@Autowired 
	UserService us;
	
    @Override 
    public void onApplicationEvent(ContextRefreshedEvent event) {
    	System.out.println("excisting items: "+is.count());
    	System.out.println("excisting users: "+us.Count());
    	if(is.count() == 0) {
			CreateDummyItems();
       }
    }
    
    public void CreateDummyItems() {
    	Item item1 = new Item();
 	   item1.setName("Melk");
 	   item1.setExpirationDate(LocalDate.now());
 	   item1.setAmount("5 gram");
 	   item1.setPhoto("data:image/jpeg;base64,");
 	   
 	   Item item2 = new Item();
 	   item2.setName("Brood");
 	   item2.setExpirationDate(LocalDate.now());
 	   item2.setAmount("1");
 	   item2.setPhoto("data:image/jpeg;base64,");
 	   
 	   Item item3 = new Item();
 	   item3.setName("Appel");
 	   item3.setExpirationDate(LocalDate.now());
 	   item3.setAmount("1");
 	   item3.setPhoto("data:image/jpeg;base64,");
	   
 	  Item item4 = new Item();
 	  item4.setName("Appel");
 	  item4.setExpirationDate(LocalDate.now());
 	  item4.setAmount("1");
 	  item4.setPhoto("data:image/jpeg;base64,");
 	   
 	  if (us.Count() == 0) {
 		  User dummyUser =  CreateDummyUser();
 		  is.CreateItem(item1, dummyUser.getId());
 		  is.CreateItem(item2, dummyUser.getId());
 		  is.CreateItem(item3, dummyUser.getId());
 		 is.CreateItem(item4, dummyUser.getId());
 		  System.out.println("created "+is.count() +" new dummy items");
 	   }
    }
    
    public User CreateDummyUser() {
    	User dummyUser = new User();
    	dummyUser.setUserName("dummy");
    	dummyUser.setPassword("123");
    	System.out.println("created a dummy user");
    	us.CreateUser(dummyUser);
    	return dummyUser;
    }
}



